INSERT INTO `artigo` VALUES (1,'BANCOS DE DADOS RELACIONAIS','Atualmente, obter informação rápida e confiável é vital para a sociedade, sobretudo\npara as organizações. Bancos de dados possibilitam o controle e a disponibilização\ndessas informações e por isso tornaram-se elementos indispensáveis. Desta forma,\no presente trabalho se propõe a abordar alguns dos principais tópicos dessa área.\nTodavia, dada a riqueza do tema e, consequentemente, sua extensão, focalizou-se\napenas os assuntos que dizem respeito a bancos de dados relacionais. Para tanto,\nfoi realizada uma pesquisa bibliográfica em algumas obras de referência. O texto a\nseguir elaborado discute, entre outros, os conceitos de bancos de dados, sistemas\nde banco de dados, modelagem semântica, modelo de dados, modelo relacional e\nlinguagem de consulta estruturada. Ao final, demonstra-se através de um estudo de\ncaso a importância da abordagem de banco de dados. Ali, também fica ratificado\nque a compreensão de assuntos concernentes ao campo de banco de dados\npropicia o desenvolvimento de projetos de banco de dados mais eficientes.'),(2,'ENSINO DE LÓGICA DE PROGRAMAÇÃO: DIFICULDADES DE APRENDIZAGEM NA PERCEPÇÃO DE PROFESSORES DO ENSINO SUPERIOR','Esta pesquisa teve como objetivo investigar as dificuldades de aprendizagem dos estudantes em lógica de programação e como planejam o ensino para a compreensão, na percepção de professores que lecionam a disciplina de Algoritmos e Lógica de Programação (ALP). Este trabalho se insere na linha de pesquisa IV, que tem como eixo temático as Práticas Educativas e Tecnologias Educacionais, do Curso de Mestrado em Educação Tecnológica do CEFET-MG. A metodologia adotada nesta pesquisa caracteriza-se por uma abordagem qualitativa, de natureza exploratória de cunho bibliográfico à luz de teóricos como Wiggins e McTigue (2019), Libâneo (2003, 2013), Dewey (2010), Papert (2007), Perrenoud (1993, 2003), Valente (1998), Zabala (1998), Bloom Hastings e Madaus (1983), Copy (1978) e Piaget (1976). O instrumento de coleta de dados utilizado foi o questionário semiestruturado aplicado de forma online em abril de 2023 e contou com a participação de 17 professores que lecionam a disciplina de ALP nos cursos de Computação e Engenharia de três unidades de ensino superior de uma rede privada, localizadas nas cidades de Belo Horizonte-MG, Betim-MG e Divinópolis-MG. Os resultados sinalizam que os participantes da pesquisa percebem que muitos estudantes enfrentam desafios significativos relacionados ao pensamento lógico e à compreensão em relação à sintaxe e semântica das estruturas de programação. Eles acreditam que essas dificuldades têm origem na falta de estímulo precoce para o desenvolvimento do pensamento lógico, à base deficiente em raciocínio lógico e o impacto negativo das tecnologias digitais, que muitas vezes torna mais cômodo buscar respostas prontas do que desenvolver soluções. Os participantes enfatizam a importância de simplificar a apresentação do conteúdo da disciplina e propor aplicação prática do conteúdo por meio de resolução de problemas reais a fim de ajudar os estudantes a superarem essas dificuldades. Concluímos que uma característica marcante do planejamento do ensino para a compreensão é a ênfase na prática e na aplicação do conhecimento e que os participantes desta pesquisa reconhecem a importância de aplicabilidade do conteúdo da disciplina com situações reais e problemas cotidianos, conforme preconiza as diretrizes estabelecidas pelo Parecer CNE/CEB de 2 de fevereiro de 2022 que enfatiza a importância do desenvolvimento do pensamento computacional e a construção de algoritmos para resolver problemas do cotidiano. Que embora seja perceptível que os participantes não conheçam a teoria das seis facetas para o planejamento do ensino para a compreensão, muitos utilizam de forma intrínseca, se deparando com os desafios da diversidade de perfis dos estudantes e fatores externos, como, por exemplo, a metodologia de sala de aula invertida proposta pela instituição. Palavras-chave: Algoritmos; Lógica de Programação; Ensino Superior; Planejamento Reverso; Seis Facetas para a compreensão.'),(3,'MAPEAMENTOS CONCEITUAIS ENTRE MODELO RELACIONAL E\nESTRUTURAS NOSQL: UM ESTUDO DE CASO COM\nDOCUMENTOS','As atuais perspectivas computacionais, sobretudo vindas da Internet, têm gerado novas\ndemandas na manipulação de dados que são cada vez maiores em volume, heterogeneidade e\ndinamismo. Este fato tem ocasionado alguns gargalos em aplicações no mercado devido ao\ndescompasso das crescentes requisições e às atuais estruturas de dados adotadas. Uma proposta\npara enfrentar esse desafio é a utilização dos denominados sistemas de bancos de dados NoSQL\nque se diferenciam dos sistemas baseados no Modelo Relacional por possibilitar a\nimplementação de estruturas mais flexíveis. Contudo, a maioria das bases de dados do mercado\nvem sendo projetada em estruturas relacionais, e a migração de uma base que segue o Modelo\nRelacional para outro requer grande esforço dos projetistas diante das diferenças existentes e\nfalta da automatização desse processo.\nAssim, equipes de desenvolvimento se deparam com esse fato e necessitam desenvolver,\nmuitas vezes, soluções de conversão dos dados do Modelo Relacional para essas novas\nestruturas. Porém, algumas dessas soluções são específicas para cada estrutura de dados, não\nsendo replicáveis em outras situações ou com outras bases de dados.\nNesse sentido, este trabalho apresenta uma abordagem para conversão de estruturas de\ndados relacionais para sistemas NoSQL. Para isso, ele compara as estruturas de dados do modelo\nrelacional com as quatro abordagens NoSQL (Chave-valor, Colunas, Documentos e Grafos),\ngerando um conjunto de correspondências estruturais, e regras de conversão do modelo\nrelacional para as abordagens NoSQL. O trabalho incluiu o desenvolvimento de um protótipo de\numa ferramenta que implementa a conversão entre dados de um banco Relacional para o NoSQL\nbaseado em documentos (MongoDB). Por fim, o trabalho mostra alguns experimentos que\ncomprovam a consistência dos resultados de consultas executadas sobre os sistemas\nmencionados.Palavras-chave: Conversão de dados. Chave-valor. Colunas. Grafo. MongoDB.');
